    "## Description of the Data\n",
    "\n",
    "The datasets have been publicly sourced by fellow Kaggle user [Shivam Bansal]( https://www.kaggle.com/shivamb/datasets). \n",
    "\n",
    "The dataset contains the following attributes:\n",
    "\n",
    "    show_id: A unique ID for every movie or show\n",
    "    type: Identifier – A Movie or Tv Show\n",
    "    title: Title of the movie / show\n",
    "    director: Director of the Movie\n",
    "    cast: Actors involved in the movie / show\n",
    "    country: Country where the movie / show was produced\n",
    "    date_added: Date it was added on the platform\n",
    "    release_year: Actual release year of the movie / show\n",
    "    rating: Tv rating of the movie / show\n",
    "    duration: Total duration – in minutes or number of seasons\n",
    "\n",
    "The following Key feature attributes were added during the data cleaning process to aid the analysis:\n",
    "\n",
    "    year_added:\n",
    "    genre:\n"
   ]
