    "#data mapping setup\n",
    "\n",
    "#netflix\n",
    "netflix <- stream_platforms %>% \n",
    "  filter(platform==\"Netflix\")\n",
    "\n",
    "netflix_genre <- genre_final %>% \n",
    "  filter(platform==\"Netflix\")\n",
    "\n",
    "netflix_map <- netflix %>% \n",
    "  group_by(platform, rating) %>% \n",
    "  count(rating) %>% \n",
    "  summarise(total=sum(n)) %>% \n",
    "  mutate(percent = round(total /sum(total)*100, digits = 2)) \n",
    "#amazon\n",
    "amazon <- stream_platforms %>% \n",
    "  filter(platform==\"Amazon\")\n",
    "\n",
    "amazon_genre <- genre_final %>% \n",
    "  filter(platform==\"Amazon\")\n",
    "\n",
    "amazon_map <- amazon %>% \n",
    "  group_by(platform, rating) %>% \n",
    "  count(rating) %>% \n",
    "  summarise(total=sum(n)) %>% \n",
    "  mutate(percent = round(total /sum(total)*100, digits = 2))\n",
    "#hulu\n",
    "hulu <- stream_platforms %>% \n",
    "  filter(platform==\"Hulu\")\n",
    "\n",
    "hulu_genre <- genre_final %>% \n",
    "  filter(platform==\"Hulu\")\n",
    "\n",
    "hulu_map <- hulu %>% \n",
    "  group_by(platform, rating) %>% \n",
    "  count(rating) %>% \n",
    "  summarise(total=sum(n)) %>% \n",
    "  mutate(percent = round(total /sum(total)*100, digits = 2)) \n",
    "#disney\n",
    "disney <- stream_platforms %>% \n",
    "  filter(platform==\"Disney\")\n",
    "\n",
    "disney_genre <- genre_final %>% \n",
    "  filter(platform==\"Disney\")\n",
    "\n",
    "disney_map <- disney %>% \n",
    "  group_by(platform, rating) %>% \n",
    "  count(rating) %>% \n",
    "  summarise(total=sum(n)) %>% \n",
    "  mutate(percent = round(total /sum(total)*100, digits = 2)) \n"
